import React, { Component } from 'react';
export default class TwoBoxes extends Component {
  render() {
    return (
      <React.Fragment>
<section id="twoboxes">
    <div className="six columns collapsed">
    <div className="item-wrap">
        <img className="profile-pic" src="images/toldyou.jpg" alt="" />


    </div>  
    </div>  

</section> {/* TwoBoxes Section End*/}

      </React.Fragment>
    );
  }
}
